def restore(output: Path) -> None:
    data = base64.b64decode(XLSX_BASE64)
    output.write_bytes(data)
    digest = hashlib.sha256(data).hexdigest()
    if digest != EXPECTED_SHA256:
        raise RuntimeError(f"SHA256 校验失败: {digest} != {EXPECTED_SHA256}")
    print(f"已生成: {output}")
    print(f"SHA256: {digest}")

def main() -> None:
    parser = argparse.ArgumentParser(description="复原 政策大模型.xlsx")
    parser.add_argument("--output", type=Path, default=Path("政策大模型.xlsx"), help="输出文件路径")
    args = parser.parse_args()
    restore(args.output)

if __name__ == "__main__":
    main()
